import React from "react";
import Button from "../../components/button/Button";

const Home = () => {
  return (
    <div className="home">
      <nav className="nav-bar">
        <h3>CareFinder</h3>
        <ul>
          <li>Home</li>
          <li>About</li>
          <li>Find Hospital</li>
          <li>
            <Button btnText="Login" />
          </li>
          <li>
            <Button btnText="Signup" />
          </li>
        </ul>
      </nav>
      <h1>Welcome to the home page</h1>
    </div>
  );
};

export default Home;
